import{_ as a,c as r,o as t,ae as n}from"./chunks/framework.tuuL-SzM.js";const u=JSON.parse('{"title":"Кто мы?","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"ru/trz-team/index.md","filePath":"ru/trz-team/index.md"}'),i={name:"ru/trz-team/index.md"};function o(s,e,l,h,p,c){return t(),r("div",null,e[0]||(e[0]=[n('<div class="warning custom-block"><p class="custom-block-title">ПРЕДУПРЕЖДЕНИЕ</p><p>Страница не готова, она находится в статусе разработки.</p></div><h1 id="кто-мы" tabindex="-1">Кто мы? <a class="header-anchor" href="#кто-мы" aria-label="Permalink to &quot;Кто мы?&quot;">​</a></h1><p>Мы TRZ Team - команда 3squad занимающаяся созданием проектов в Minecraft. Наша команда состоит из трёх человек: zcript_, dscss2 и TweaksWr.</p><p>Наша команда создала и создаёт много проектов, такие как: ZXRP, RS Engine (в разработке первой alpha версии), DisAuth (в разработке первого релиза).</p><h2 id="о-проекте-zxrp" tabindex="-1">О проекте <a href="/ru/zxrp/">ZXRP</a> <a class="header-anchor" href="#о-проекте-zxrp" aria-label="Permalink to &quot;О проекте [ZXRP](/ru/zxrp/)&quot;">​</a></h2><p>ZXRP - ресурспак, добавляющий большое количество РП предметов. ZXRP не изменяет стандартные текстуры Minecraft, он добавляет переименования на предметы, после чего текстура предмета меняется. ZXRP был создан специально для ванила сервера, после чего стал независимым от сервера.</p><p>На данный момент ежемесячно обновляется и загружается на <a href="https://modrinth.com/resourcepack/zxrp" target="_blank" rel="noreferrer">Modrinth</a>.</p><h2 id="о-проекте-rs-engine" tabindex="-1">О проекте RS Engine <a class="header-anchor" href="#о-проекте-rs-engine" aria-label="Permalink to &quot;О проекте RS Engine&quot;">​</a></h2><p>RS Engine - движок для создания сюжетных сезонов, на подобии блогера <a href="https://www.youtube.com/@MrLololoshka" target="_blank" rel="noreferrer">MrLololoshka</a>. На данный момент RS Engine находится в статусе разработки первой Alpha версии, поэтому более подробной информации не можем написать.</p><h2 id="о-проекте-disauth" tabindex="-1">О проекте DisAuth <a class="header-anchor" href="#о-проекте-disauth" aria-label="Permalink to &quot;О проекте DisAuth&quot;">​</a></h2><p>DisAuth - плагин для Minecraft серверов, связующий Discord аккаунт с сервером. На данный момент DisAuth находится в статусе разработки первого релиза, поэтому более подробной информации не можем написать.</p>',11)]))}const _=a(i,[["render",o]]);export{u as __pageData,_ as default};
